DELIMITER $$
CREATE TRIGGER `tr_update_order_total_delete` 
AFTER DELETE ON `order_items` 
FOR EACH ROW 
BEGIN
    UPDATE orders 
    SET total_amount = (
        SELECT COALESCE(SUM(total_price), 0) 
        FROM order_items 
        WHERE order_id = OLD.order_id
    )
    WHERE id = OLD.order_id;
END$$
DELIMITER ;
